import React, { useEffect, useState } from 'react'
import Axios from 'axios'

export const Tabla = () => {

    const [pacientes, setPacientes] = useState([])
    useEffect(() => {
        Axios.get('https://api-rest-fedent.herokuapp.com/pacientes').then( (response) =>{
        setPacientes(response.data)
        })

    }, [])
    console.log(pacientes)

    return (
        <div className="mt-5">
            <table class="table">
                <thead>
                    <tr>
                    <th scope="col">ID</th>
                    <th scope="col">Nombre</th>
                    <th scope="col">Rut</th>
                    <th scope="col">Domicilio</th>
                    <th scope="col">Telefono</th>
                    <th scope="col"></th>
                    </tr>
                </thead>
                <tbody>
                    {pacientes.map( (paciente, i) => {
                        return (
                        <>
                            <tr>
                                <th scope="row" key={i}>{paciente.id_paciente}</th>
                                <td key={i}>{paciente.nombre}</td>
                                <td key={i}>{paciente.rut}</td>
                                <td key={i}>{paciente.domicilio}</td>
                                <td key={i}>{paciente.telefono}</td>
                            </tr>

                        </>
                        )

                    })}

                </tbody>
            </table>
        </div>
    )
}
